import React from 'react';
import Login from "./pages/Login";
import {BrowserRouter, Route, Router} from "react-router-dom";



const App = () => {

    return (
        <div>
            <BrowserRouter>
                <Router>

                <Route path="/login"  element={Login} ></Route>
                </Router>

            </BrowserRouter>
        </div>

    );
};

export default App;
